void OAIProductsApi::updateProduct(const QString &organization_uuid, const QString &product_uuid, const OAIFullProductUpdateRequest &oai_full_product_update_request, const ::OpenAPI::OptionalParam<QString> &if_match) {
    QString fullPath = QString(_serverConfigs["updateProduct"][_serverIndices.value("updateProduct")].URL()+"/organizations/{organizationUuid}/products/v2/{productUuid}");
    
    
    {
        QString organization_uuidPathParam("{");
        organization_uuidPathParam.append("organizationUuid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "organizationUuid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"organizationUuid"+pathSuffix : pathPrefix;
        fullPath.replace(organization_uuidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(organization_uuid)));
    }
    
    {
        QString product_uuidPathParam("{");
        product_uuidPathParam.append("productUuid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "productUuid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"productUuid"+pathSuffix : pathPrefix;
        fullPath.replace(product_uuidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(product_uuid)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "PUT");

    {

        
        QByteArray output = oai_full_product_update_request.asJson().toUtf8();
        input.request_body.append(output);
    }
    if (if_match.hasValue())
    {
        if (!::OpenAPI::toStringValue(if_match.value()).isEmpty()) {
            input.headers.insert("If-Match", ::OpenAPI::toStringValue(if_match.value()));
        }
        }
    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIProductsApi::updateProductCallback);
    connect(this, &OAIProductsApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });
    _OauthMethod = 2;
    _implicitFlow.unlink();
    _credentialFlow.unlink();
    _passwordFlow.unlink();
    _authFlow.link();
    QStringList scope;
    scope.append("WRITE:PRODUCT");
    auto token = _authFlow.getToken(scope.join(" "));
    if(token.isValid())
        input.headers.insert("Authorization", "Bearer " + token.getToken());

    _latestWorker = new OAIHttpRequestWorker(this, _manager);
    _latestWorker->setTimeOut(_timeOut);
    _latestWorker->setWorkingDirectory(_workingDirectory);

    connect(_latestWorker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIProductsApi::updateProductCallback);
    connect(this, &OAIProductsApi::abortRequestsSignal, _latestWorker, &QObject::deleteLater);
    connect(_latestWorker, &QObject::destroyed, [this](){
        if(findChildren<OAIHttpRequestWorker*>().count() == 0){
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    _latestInput = input;
    _latestScope = scope;




    worker->execute(&input);
}

